import React, { Component } from "react";

import {
  View,
  Text,
  Platform,
  TextInput,
  StyleSheet,
  Button,
} from "react-native";

export default class NewButton extends Component {
  static propTypes = {
    list: Array,
  };

  constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
  }
  handleClick() {
    this.props.list.push({
      key: 5,
      date: "2021.10.28",
      mileage: 190947,
      volume: 33.53,
      price: 14000,
    });
    alert(this.props.list.length);
  }
  render() {
    return (
      <View>
        <button onClick={this.handleClick}>My button</button>
      </View>
    );
  }
}

const styles = StyleSheet.create({});
